function ExpenseDate(props){
    const month=props.buyDate.toLocaleString('en-US',{month:'long'});
    const date=props.buyDate.toLocaleString('en-US',{day:'2-digit'});
    const year=props.buyDate.getFullYear();
    return(<div>
        <div>{date}</div>
        <div>{month}</div>
        <div>{year}</div>
    </div>);
}
export default ExpenseDate;
